import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import './MenuDesp.css'
export class MenuDesp extends Component {
    render() {
        return (
            <div id="menu__responsive-des" >
                <Link to="/"><div>Home</div></Link>
                <Link to="/Portales"><div>Portales</div></Link>
                <Link to="/RestBlocks"><div>Distancia</div></Link>
                <Link to="/Circulos"><div>Circulos</div></Link>
            </div>
        )
    }
}

export default MenuDesp
